import React from "react";
import Home from "./pages/Home";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.setPage.bind(this);

    this.state = {
      page: null,
    };
  }

  componentDidMount() {
    this.setPage(<Home setPage={this.setPage} />);
  }

  setPage(page) {
    this.setState({ page: "page" });
  }

  render() {
    return this.state.page;
  }
}

export default App;
